var usuarioService={updateGrupoTree:function(e,s){try{connector.post(url.usuario.updateTree,JSON.stringify(e),function(e){null!=e?(s(e),successMessage({title:message.usuario.update.title,content:message.usuario.update.success})):infoMessage({title:message.usuario.update.title,content:message.usuario.update.error})})}catch(e){console.log(e)}},updateUsuarioClave:function(e,s){try{connector.post(url.usuario.updateClave,JSON.stringify(e),function(e){null!=e?0===e?errorMessage({title:message.usuario.update.title,content:message.usuario.update.clave}):(s(e),successMessage({title:message.usuario.update.title,content:message.usuario.update.success})):infoMessage({title:message.usuario.update.title,content:message.usuario.update.error})})}catch(e){console.log(e)}}};